const parseString = require('xml2js').parseString;
const xml2js = require('xml2js')
const jmespath = require('jmespath')
const CustomInfo = require('./custom_info.js')
const fetch = require('node-fetch')
const docId = '9663f0ba-45ee-432b-a2b7-69066c07d431'
const Bluebird = require('bluebird')
fetch.Promise = Bluebird


mapCdl(testCDL,(err,result)=>{
  if(err){
    console.log(err);
  }else{
    getTemplateCdl(result);
  }
})

function mapCdl(cdl,callback){
    parseString(cdl,{attrkey:"Attr"},(err, result)=>{
      let customInfo = new CustomInfo(result)
      callback(null,customInfo)
    })
}

function getTemplateCdl(customInfo){
  const url = 'https://fullgearub.cadworxase.p.azurewebsites.net/Core2/Doc/Read'
  const body = {
    'config':"FullgearUB",
    'ident':{
      'sessionid': "947c6c7c-e7df-48a9-9ce5-46a0d5986af6",
      'superuser': false
    },
    'model':{
      'Id': '9663f0ba-45ee-432b-a2b7-69066c07d431'
    }
  }
  console.log(JSON.stringify(body));
  fetch(url, {
    'method': 'POST',
    'body': JSON.stringify(body),
    'headers': {
      'Content-Type':'application/json'
    }
  }).then(res => res.json())
    .then(json => parseString(json.Model.Cdl,{attrkey:"Attr"},(err,result) =>{
      console.log(result);
      getEditPaths(customInfo,result)
      reconcileCdl(customInfo,result)
      console.log(result);
      let builder = new xml2js.Builder({attrkey:"Attr"})
      let cdl = builder.buildObject(result)
      console.log(cdl)
    }))
}

function getEditPaths(customInfo,cdl){
  for(let i = 0;i<customInfo.document.regions.length;i++){
    let paths = search(cdl,{
      key: "ZoneName",
      comparator:"==",
      value:customInfo.document.regions[i].regionName,
      node:"grandparent"
    });
    customInfo.document.regions[i].editPaths = paths
  }
}

function reconcileCdl(customInfo,originalCdl){
  if(customInfo.document.regions){
    for(let region of customInfo.document.regions){
      changeCdl(originalCdl,region.color,region.editPaths,".Polyregion[0].Brush[0].Color[0].Attr")
    }
  }
  if(customInfo.document.decorations){
    for(let decoration of customInfo.document.decorations){
      switch(true){
        case (decoration.type === "Logo") : if(decoration.content[0].Polyregion){
          originalCdl.Cdl.Document[0].Pages[0].Page[0].Layers[0].Layer[1].Figures[0].Shape.push(decoration.content[0])
        }else {
          if(!originalCdl.Cdl.Document[0].Pages[0].Page[0].Layers[0].Layer[1].Figures[0].Raster) originalCdl.Cdl.Document[0].Pages[0].Page[0].Layers[0].Layer[1].Figures[0].Raster = []
          originalCdl.Cdl.Document[0].Pages[0].Page[0].Layers[0].Layer[1].Figures[0].Raster.push(decoration.content[0])
        }
        break;
        case (decoration.type === "Text") :
          if(!originalCdl.Cdl.Document[0].Pages[0].Page[0].Layers[0].Layer[1].Figures[0].TextBlock) originalCdl.Cdl.Document[0].Pages[0].Page[0].Layers[0].Layer[1].Figures[0].TextBlock = []
          originalCdl.Cdl.Document[0].Pages[0].Page[0].Layers[0].Layer[1].Figures[0].TextBlock.push(decoration.content[0])
      }
    }
  }
}

function changeCdl(cdl,change,paths,pathExtension){
  for(let i = 0; i < paths.length; i++){
    eval("cdl."+paths[i]+pathExtension+"="+JSON.stringify(change))
  }
}

function getKeyString(key){
  if(Number.isInteger(parseInt(key)) == true){
   return '['+key+']'
 }else{
   return '.'+key
 }
}

function search(cdl,testParams,path){
  let keys;
  let paths = []
  if(typeof eval('cdl.'+path) == 'string' || typeof eval('cdl.'+path) == 'integer'){
    if(eval('cdl.'+path+testParams.comparator+'"'+testParams.value+'"')==true && path.match(/[A-Za-z0-9_-]+$/)[0]==testParams.key){
      switch(true){
        case(testParams.node == "parent"): paths.push(path.replace(/.[A-Za-z0-9_-]+$/,''))
        break;
        case(testParams.node == "grandparent"): paths.push(path.replace(/.[A-Za-z0-9_-]+.[A-Za-z0-9_-]+$/,''))
        break;
        default: paths.push(path)
      }
      return paths
    }else {
      return
    }
  }
  if(path){
    keys = Object.keys(eval('cdl.'+path))
    if(keys.length > 1){
      for(let i = 0; i < keys.length; i++){
        let keyString = getKeyString(keys[i])
        let result = search(cdl,testParams,path+keyString)
        if(result) paths = paths.concat(result)
      }
    }else{
      let keyString = getKeyString(keys[0])
      let result = search(cdl,testParams,path+keyString)
      if(result) paths = paths.concat(result)
    }
  }else{
    keys = Object.keys(cdl)
    if(keys.length > 1){
      for(let i = 0; i < keys.length; i++){
          paths = paths.concat(search(cdl,testParams,keys[i]))
      }
    }else{
        paths = paths.concat(search(cdl,testParams,keys[0]))
    }
  }
  return paths
}
